title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o15674.m19 -> o15688.m0 -> o15674.m19
  o15688.m1 -> o15674.m30 -> o15688.m0 -> o15674.m19 -> o15688.m0
  o15688.m7 -> o15674.m30 -> o15688.m0 -> o15674.m19 -> o15688.m0
  o15674.m30 -> o15688.m0 -> o15674.m19 -> o15688.m0
  o15688.m0 -> o15674.m19 -> o15688.m0
  o15688.m8 -> o15674.m30 -> o15688.m0 -> o15674.m19 -> o15688.m0
  o15686.m26 -> o15681.m18 -> o15686.m36 -> o15675.m38 -> o15686.m36
  o15686.m36 -> o15675.m38 -> o15686.m36
  o15675.m38 -> o15686.m36 -> o15675.m38
  o15681.m18 -> o15686.m36 -> o15675.m38 -> o15686.m36
  o15674.m34 -> o15675.m38 -> o15686.m36 -> o15675.m38

features:
  - inheritance
  - overriding
  - method
  - polymorphism

